import React from 'react'
import'./about.css';

export default function About() {
  return (
    <div className='box-about'>
 

    <h1 className='titulo-name'>Alexander Arvelo</h1>
    
     <p className='descrip'>Hola, soy Full Stack developer con experiencia en varios proyectos en el área.
       Me considero una persona responsable y dedicada, estoy buscando una empresa que me brinde la oportunidad de seguir creciendo profesionalmente.
       Mi enfoque se centra en la creación de soluciones tecnológicas innovadoras y estoy constantemente aprendiendo nuevas tecnologías y lenguajes de programación para mejorar mis habilidades y conocimientos.</p>
  
    </div>
  ) 
}
